import React from "react";
import styled from "styled-components";

const Container = styled.div`
  display: flex;
  padding: 20px;
  justify-content: space-between;
`;

const CategoryItem = ({ item }) => {
  return <Container>Hello</Container>;
};

export default CategoryItem;
